    false,nt"url": null,nt"notes": "The proposed project will remove small
    diameter Doug-fir trees on 45 acres of the Carty Unit at Ridgefield NWR by cutting
    or girdling. Himalayan blackberry will also be treated prior to large diametertree
    removal. During the fall of 2016 and 2017, the Friends Habitat Restoration Coordinator
    will workwith trained volunteers to apply herbicide to patches of blackberry to
    reduce the opportunities foru201crelease once the canopy trees are removed. During
    the winter of 2017, the Restoration Coordinatorwill work with volunteers to search
    and cut Doug-fir seedlings/saplings up to approximately 2u201d DBH.Work will be
    done with hand tools and sites mapped once they are cleared.In addition, the proposal
    will provide funds for a professional forester to inventory and evaluate thevalue
    number of boles and the volume of larger diameter fir trees, and develop a best
    forestry practices plan with alternatives for cutting pole-sized trees 2-9u201d
    DBH, and the removal of the larger trees (>=10 u201c DBH). It is anticipated that
    the harvested logs will be used for the proposed Steigerwald Floodplain Restoration
    Project.The forest inventory will be a 100% cruise to determine the location, number
    and size of the existingDoug-firs. The number of logs will be estimated (most of
    the larger trees will have 2 or more logs) and a map generated to identify and classify
    forest patches.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
